INSERT INTO `civiledu` VALUES (1,'Who among the following could be described as the founding father of Nigerian nationalism?','Nnamdi Azikiwe','Herbert Macauley','Ahmadu Bello','Obafemi Awolowo','','','b','','wassce','2014',65,'Admin','2016-11-26 14:40:53','2020-05-28 21:09:33'),(2,'Rule of Law means','supremacy of the law','absence of legal immunity','peace, order and stability','obedience to any authority','','','a','','wassce','2014',73,'Admin','2016-11-26 14:40:53','2020-05-28 21:09:44'),(3,'A major characteristic of civil society is','the desire to win election','corporate responsibility','social responsibility','political gerrymandering.','','','b','','wassce','2014',68,'Admin','2016-11-26 14:40:53','2020-05-28 21:09:32'),(4,'Citizenship status is acquired through','birth, indigenization, colonization and referendum','association, convention, naturalization and incorporation','birth, naturalization, honorary and registration','registration, inter-relationship, integration and declaration.','','','c','','wassce','2014',65,'Admin','2016-11-26 14:40:53','2020-05-28 21:10:05'),(5,'Human Rights are basic natural rights which people enjoy primarily because they are','members of a political party','international citizens','members of a community','human beings.','','','d','','wassce','2014',65,'Admin','2016-11-26 14:40:53','2020-05-28 21:07:45'),(6,'Interpersonal relationship exists when','citizens pay their taxes regularly to inland revenue service','citizens are politically conscious and participate in voting','there is interaction between persons in a social setting.','groups share social interest and communal aspiration','','','d','','wassce','2014',62,'Admin','2016-11-26 14:40:53','2020-05-28 21:09:13'),(7,'Cultism can be described to be','amiable','attractive','dangerous','harmless.','','','c','','wassce','2014',62,'Admin','2016-11-26 14:40:53','2020-05-28 21:09:40'),(8,'Based on the statements above, the decision of the student on having a bullet proof vest shows that cultism','spreads fear and terror.','is a training ground for armed forces.','breeds courageous graduates.','propagates self - defence.','NEWS: ‘Rival Cult Group Killed Ten on Campus’<br> 	STUDENT: I will definitely need a bullet proof vest before I can go back to the Campus.<br>','','a','','wassce','2014',75,'Admin','2016-11-26 14:40:53','2020-06-09 18:24:55'),(9,'It could be inferred from the statements above that cultism in schools could lead to','sudden prosperity.','uninterrupted academic calender.','popularity on campus.','untimely death.','NEWS: ‘Rival Cult Group Killed Ten on Campus’<br> 	STUDENT: I will definitely need a bullet proof vest before I can go back to the Campus.<br>','','d','','wassce','2014',73,'Admin','2016-11-26 14:40:53','2020-05-28 21:09:28'),(10,'Victims of human trafficking are usually compelled to engage in','lucrative employment','visiting tourist sites','part - time studies','forced labour.','','','d','','wassce','2014',67,'Admin','2016-11-26 14:40:54','2020-05-28 21:09:40'),(11,'One habit which People Living With HIV/AIDS (PLWHAs) must avoid to remain healthy and productive is','regular contact with healthy people.','self - pity and self - medication','participation in profitable ventures','pursuit of academic studies.','','','b','','wassce','2014',68,'Admin','2016-11-26 14:40:54','2020-05-28 21:09:13'),(12,'Youth empowerment is best described as the','training given to individuals for acquiring means livelihood','practice of engaging in prospective career','provision of subsidized meals to the citizens by government,','mobilization of citizens for political rally.','','','a','','wassce','2014',62,'Admin','2016-11-26 14:40:54','2020-05-28 21:10:01'),(13,'The National Assembly, Presidency and Court which are inter - related and interdependent in our democracy constitute the','tiers of government','types of democracy','forms of government.','arms of government','','','d','','wassce','2014',59,'Admin','2016-11-26 14:40:54','2020-05-28 21:09:36'),(14,'A system of government that listens to public opinion and tolerates opposition is','dictatorial regime','capitalist regime','democratic regime','socialist regime','','','c','','wassce','2014',67,'Admin','2016-11-26 14:40:54','2020-05-28 21:06:40'),(15,'A situation where most citizens fail to vote in elections could be described as political','socialization','culture.','apathy','legitimacy','','','c','','wassce','2014',60,'Admin','2016-11-26 14:40:54','2020-05-28 21:09:57'),(16,'The division of Nigeria into various constituencies with each electing a person to represent it in the National Assembly is a demonstration of','checks and balances','popular participation','political rivalry among the constituents','drive towards secession in the country.','','','b','','wassce','2014',79,'Admin','2016-11-26 14:40:54','2020-05-28 21:09:53'),(17,'In Nigeria, public servants are expected to be','non - partisan','political','ambitious','apolitical','','','a','','wassce','2014',62,'Admin','2016-11-26 14:40:54','2020-05-28 21:09:37'),(18,'The principle that public servants cannot be held responsible for their official actions denotes','impartiality','accountability','anonymity','neutrality.','','','c','','wassce','2014',77,'Admin','2016-11-26 14:40:54','2020-05-28 21:10:05'),(19,'Universal Declaration of Human Rights (UDHR) is based on the resolution of the','Human Rights Watch','United Nations Organization','Amnesty International','League of Nations.','','','b','','wassce','2014',62,'Admin','2016-11-26 14:40:54','2020-05-28 21:09:55'),(20,'According to the story, Imoh’s parents were','wealthy couple','prominent politicians','honest and responsible','religious fanatics','Imoh lived with her parents in Kakuri. They were good citizens who detested all forms of immoral acts. Both at home and in school, Imoh had been taught the virtues and values of a good citizen. However, while in a bus on her way home from school, the conductor forgot to ask for her fare. She knew that the right thing to do was to pay even when the conductor had forgotten to collect the fare. She also knew that there were other things she could do with the money if it was not paid, but she did what was expected by informing the conductor and paying the fare.','','c','','wassce','2014',73,'Admin','2016-11-26 14:40:54','2020-05-28 21:09:41'),(21,'What value did Imoh demonstrate.','Tolerance','Confidence','Fair play','Honesty','Imoh lived with her parents in Kakuri. They were good citizens who detested all forms of immoral acts. Both at home and in school, Imoh had been taught the virtues and values of a good citizen. However, while in a bus on her way home from school, the conductor forgot to ask for her fare. She knew that the right thing to do was to pay even when the conductor had forgotten to collect the fare. She also knew that there were other things she could do with the money if it was not paid, but she did what was expected by informing the conductor and paying the fare.','','d','','wassce','2014',62,'Admin','2016-11-26 14:40:54','2020-05-28 21:08:52'),(22,'Conflicts are better resolved in the society through','tribunal','litigation.','dialogue','the court','','','c','','wassce','2014',69,'Admin','2016-11-26 14:40:54','2020-06-09 11:26:22'),(23,'To prevent the spread of HIV/AIDS, people should be encouraged to','avoid casual sexual activities','marry very early in life','engage in gainful employment','pursue higher education','','','a','','wassce','2014',74,'Admin','2016-11-26 14:40:54','2020-05-28 21:08:49'),(24,'The nearest government to the people and an important means of promoting grassroots development is the','state government','unitary government','local government','federal government','','','c','','wassce','2014',65,'Admin','2016-11-26 14:40:54','2020-05-28 21:09:44'),(25,'Democratic governance is usually characterized by','free, fair and credible elections','buoyant and competitive economy','accessible employment opportunities','youth participation in governance','','','a','','wassce','2014',78,'Admin','2016-11-26 14:40:54','2020-05-28 21:09:55'),(26,'Political apathy often leads to','low level of participation','good governance','political stability','low literacy level','','','a','','wassce','2014',70,'Admin','2016-11-26 14:40:54','2020-05-28 21:09:46'),(27,'Which of the following is not necessary for public servants to perform effectively?','In - service training','Appointment based on nepotism','Value re - orientation for public servants','Incentives for meeting set goals','','','b','','wassce','2014',66,'Admin','2016-11-26 14:40:54','2020-05-28 21:09:09'),(28,'One of the conditions which can limit the enjoyment of Human Rights in Nigeria is the','acceptance of foreign aid by the government','improvement in literacy level of the citizens','declaration of state of emergency by government','periodic review of the constitution by government','','','c','','wassce','2014',69,'Admin','2016-11-26 14:40:54','2020-05-28 21:10:01'),(29,'The implication of positive communal relationships is that it','promotes solidarity and love','ensures obedience to constituted authority','encourages ethnic diversity','promotes rural-urban drift.','','','a','','wassce','2014',69,'Admin','2016-11-26 14:40:54','2020-05-28 21:10:07'),(30,'One major factor that attracts some Nigerians into human trafficking is','over - population related issues','influx of foreigners into the country','insatiable quest for quick wealth','influence of Western and social media','','','c','','wassce','2014',70,'Admin','2016-11-26 14:40:54','2020-05-28 21:09:37'),(31,'One of the reasons most HIV/AIDS patients are 	reluctant to disclose their status is because of','the incurable nature of the ailment','fear of social stigmatization.','lack of sufficient public awareness','shortage of health counsellors','','','b','','wassce','2014',56,'Admin','2016-11-26 14:40:54','2020-05-28 21:09:48'),(32,'The position of the court on this matter justifies the essence of the','rule of law','legislature','police command','separation of powers','The Bawali High Court has ordered the police in Area Z Command to produce Mr. Zeb, who is in police custody for an alleged offence. The court insists that Mr. Zeb cannot be punished until he is found guilty of breach of any law of the land by a court of competent jurisdiction.','','a','','wassce','2014',66,'Admin','2016-11-26 14:40:54','2020-05-28 21:10:01'),(33,'Leaders can best protect the interests of their followers by','embarking on periodic constitutional review','creating socio - economic opportunities for foreigners','creating conducive atmosphere for participation','rewarding supporters with contracts','','','c','','wassce','2014',72,'Admin','2016-11-26 14:40:54','2020-05-28 21:10:05'),(34,'The most popular means through which citizens of a country can participate in politics is by','being members of political parties','engaging in constructive criticism','engaging in political debates','voting in elections','','','d','','wassce','2014',70,'Admin','2016-11-26 14:40:54','2020-05-28 21:08:51'),(35,'Civil societies are vital for the promotion of popular participation because they are','profit - oriented organizations','engaged in developmental programmes','involved in political education','formidable oppositions to government','','','c','','wassce','2014',70,'Admin','2016-11-26 14:40:55','2020-05-28 21:10:00'),(36,'From this dialogue, it is very likely that Wanja will be exhibiting the following characters except','disobedience to constituted authority','truancy and perpetual lateness to school','hospitable attitude towards people','arrogance and unruly behaviour.','Ada:      Wanja, where are you going to in this ungodly hour of the night? <br> 	Wanja:   I am heading towards my usual joint to enjoy myself <br>	 	Ada:       Which joint?<br> 	Wanja:   XYZ. Night Club, where I take marijuana and alcoholic beverages. I really want to be high 			      tonight so that when people