ion','an ethically bankrupt country','Oh Motherland, you were a precious country, a beacon of hope and aspiration as well as toga of pride of your citizens at independence. However, today you are bedeviled with evil, engulfed in darkness and to say the obvious, at the edge of total moral collapse. Corruption, fraud, deception and dishonesty are prevalent; drug peddlers are having a field day. In schools and colleges, radicalism, prostitution, cultism, examination malpractice among other social vices are order of the day.','','b','','wassce','2016',64,'Admin','2016-12-12 19:57:15','2020-05-28 21:08:14'),(380,'In spite of the state of affairs reflected in the above monologue, the citizens can make the country better by being committed to','promoting inter-communal relations','strengthening capacity building','championing moral values','encouraging interpersonal relations','Oh Motherland, you were a precious country, a beacon of hope and aspiration as well as toga of pride of your citizens at independence. However, today you are bedeviled with evil, engulfed in darkness and to say the obvious, at the edge of total moral collapse. Corruption, fraud, deception and dishonesty are prevalent; drug peddlers are having a field day. In schools and colleges, radicalism, prostitution, cultism, examination malpractice among other social vices are order of the day.','','c','','wassce','2016',65,'Admin','2016-12-12 19:57:15','2020-05-28 21:09:49'),(381,'Based on the monologue above, the best approach to curb moral decadence in the motherland is by','value re-orientation','introducing war against corruption','legalizing capital punishment','sending corrupt officials on exile','Oh Motherland, you were a precious country, a beacon of hope and aspiration as well as toga of pride of your citizens at independence. However, today you are bedeviled with evil, engulfed in darkness and to say the obvious, at the edge of total moral collapse. Corruption, fraud, deception and dishonesty are prevalent; drug peddlers are having a field day. In schools and colleges, radicalism, prostitution, cultism, examination malpractice among other social vices are order of the day.','','a','','wassce','2016',63,'Admin','2016-12-12 19:57:16','2020-05-28 21:10:01'),(382,'The most important contribution of responsible parenthood to national development is that it','increases youthful population','fosters national integration','augments the nation workforce','breeds dependable citizenry','','','c','','wassce','2016',66,'Admin','2016-12-12 19:57:16','2020-06-25 23:00:33'),(383,'Which of the following can not be easily abused?','Cosmetics','Stimulant','Tobacco','Narcotics','','','a','','wassce','2016',62,'Admin','2016-12-12 19:57:16','2020-05-28 21:10:00'),(384,'Dr. Fajir cannot exercise some basic rights because he','was a suspect in a criminal case','was found guilty of a criminal offence','failed to comply with court order','embezzled public fund','Dr. Fajir was the Minister of Works and Urban Development in the Gambia Republic. As such, he was entrusted with the public fund so that his ministry could construct new roads and rehabilitate the existing ones. Unfortunately. Dr Fajir embezzled the money entrusted in his care and siphoned same to his foreign accounts. This led to the deplorable conditions of roads in the Republic. The Crime Commission arrested and prosecuted him accordingly. Subsequently, he was given the opportunity to be defended by lawyers of his choice in a Court of Law. However, he was found guilty and sentenced to 15 years imprisonment with hard labour without the option of a fine. In addition, he forfeited all his ill-gotten wealth to the Republic.','','b','','wassce','2016',101,'Admin','2016-12-12 19:57:16','2020-06-22 16:11:57'),(385,'According to the above story, the open trial of Dr. Fajir and his representation by lawyers of his choice in a court of competent jurisdiction is an indication of','respect for habeas corpus','freedom of expression','respect for human rights','freedom of legal representation','Dr. Fajir was the Minister of Works and Urban Development in the Gambia Republic. As such, he was entrusted with the public fund so that his ministry could construct new roads and rehabilitate the existing ones. Unfortunately. Dr Fajir embezzled the money entrusted in his care and siphoned same to his foreign accounts. This led to the deplorable conditions of roads in the Republic. The Crime Commission arrested and prosecuted him accordingly. Subsequently, he was given the opportunity to be defended by lawyers of his choice in a Court of Law. However, he was found guilty and sentenced to 15 years imprisonment with hard labour without the option of a fine. In addition, he forfeited all his ill-gotten wealth to the Republic.','','c','','wassce','2016',67,'Admin','2016-12-12 19:57:16','2020-05-28 21:09:48'),(386,'Based on the above story, which of the following would Dr.Fajir not be allowed to do while in prison?','Voting during elections','Engaging in hard labour','Participating in prison fellowship','Writing examination','Dr. Fajir was the Minister of Works and Urban Development in the Gambia Republic. As such, he was entrusted with the public fund so that his ministry could construct new roads and rehabilitate the existing ones. Unfortunately. Dr Fajir embezzled the money entrusted in his care and siphoned same to his foreign accounts. This led to the deplorable conditions of roads in the Republic. The Crime Commission arrested and prosecuted him accordingly. Subsequently, he was given the opportunity to be defended by lawyers of his choice in a Court of Law. However, he was found guilty and sentenced to 15 years imprisonment with hard labour without the option of a fine. In addition, he forfeited all his ill-gotten wealth to the Republic.','','a','','wassce','2016',64,'Admin','2016-12-12 19:57:16','2020-05-28 21:09:01'),(387,'The most important place for building good values is the','social welfare centre','workplace','family','media houses','','','c','','wassce','2016',58,'Admin','2016-12-12 19:57:16','2020-05-28 21:09:49'),(388,'Citizen’s compliance with tenets of the Nigerian National Pledge will enable the country to','receive reciprocal assistance','witness value clarification','get international aid','experience development','','','b','','wassce','2016',60,'Admin','2016-12-12 19:57:16','2020-05-28 21:09:17'),(389,'Which of the following statements may be true about the behaviour of the candidates in the diagram?','The candidates are doing what is ethical','Candidates involved in malpractice should be banned for life','Their action can also affect innocent candidates','Their misconduct will guarantee a reliable certificate','','','b','','wassce','2015',64,'Admin','2016-12-12 20:15:41','2020-05-28 21:09:09'),(390,'Based on the above diagram, the candidates would not have cheated if','they were well-spaced','there was an invigilator','they were hardworking','there was nobody to copy from','','','c','','wassce','2015',67,'Admin','2016-12-12 20:15:41','2020-05-28 21:09:29'),(391,'In which year did the United Nations General Assembly adopt the Universal Declaration of Human Rights?','1945','1946','1947','1948','','','a','','wassce','2015',60,'Admin','2016-12-12 20:15:41','2020-05-28 21:09:29'),(392,'Two forms of road signs are regulatory and','punitive','informative','persuasive','inhibitive','','','b','','wassce','2015',67,'Admin','2016-12-12 20:15:41','2020-05-28 21:09:21'),(393,'Which of the following factors does not affect interpersonal relationship?','Communication','Withdrawal','Compatibility','Forgiveness','','','b','','wassce','2015',69,'Admin','2016-12-12 20:15:41','2020-05-28 21:08:59'),(394,'The following cadre of students are the main target for campus cult membership except','students from wealthy homes','students from influential parents','bold and morally sound students','wayward and fun-loving students','','','c','','wassce','2015',66,'Admin','2016-12-12 20:15:41','2020-05-28 21:09:56'),(395,'The National Agency for Food and Drug Administration and Control (NAFDAC) was established in','1993','1996','1999','2001','','','a','','wassce','2015',77,'Admin','2016-12-12 20:15:42','2020-05-28 21:10:00'),(396,'National Agency for the Prohibition of Traffic in Persons (NAPTIP) is an initiative of','Federal Government of Nigeria','United States Agency for International Development','Woman Trafficking and Child Labour Eradication 	Foundation','United Nations Office on Drugs and Crime','','','a','','wassce','2015',60,'Admin','2016-12-12 20:15:42','2020-05-28 21:09:24'),(397,'World AIDS day is observed on','20th May','30th July','27th August','1th December','','','d','','wassce','2015',57,'Admin','2016-12-12 20:15:42','2020-05-28 21:09:04'),(398,'An enabling environment created to help an individual have effective control of his/her situation is known as','reinforcement','empowerment','endowment','enhancement','','','b','','wassce','2015',71,'Admin','2016-12-12 20:15:42','2020-05-28 21:08:09'),(399,'In order to avoid undue interference in the process of governance, there should be','clear cut separation of governmental powers','proper fusion of governmental powers and functions','more roles for traditional rulers in the governmental process','additional responsibility for local government council','','','a','','wassce','2015',78,'Admin','2016-12-12 20:15:42','2020-05-28 21:09:57'),(400,'Red-tapism is one the shortcomings of','private enterprise','public service','non-governmental organization','pressure groups','','','b','','wassce','2015',67,'Admin','2016-12-12 20:15:42','2020-05-28 21:09:57'),(401,'An ideology that aims at promoting national consciousness and identity is','nationalism','socialization','civic culture','progressivism','','','a','','wassce','2015',62,'Admin','2016-12-12 20:15:42','2020-05-28 21:08:05'),(402,'Human rights are described as inviolable mainly because they are','authoritative declaration','enforceab