portant segment of the society which is distinct from government, business and home is the','civil society','public service','mass media','traditional institution','','','a','','wassce','2015',74,'Admin','2016-12-12 20:15:43','2020-05-28 21:08:22'),(416,'HIV/AIDS is generally described as terminal in nature because it is','preventable','transmittable','avertable','incurable','','','d','','wassce','2015',70,'Admin','2016-12-12 20:15:43','2020-05-28 21:10:07'),(417,'Inter-communal relationship is best described as','the interaction between individuals, groups or organizations with common aspirations','the interaction among individuals and professionals in a social setting','loyalty to community leaders so as to achieve rapid communal development','respect for collective national symbols in order to foster nationalistic feeling','','','a','','wassce','2015',58,'Admin','2016-12-12 20:15:43','2020-05-28 21:09:44'),(418,'A situation whereby someone is obliged to inform a superior about his actions and decisions for the purpose of control is','probity','self-discipline','accountability','fair play','','','c','','wassce','2015',73,'Admin','2016-12-12 20:15:43','2020-05-28 21:07:46'),(419,'The above quotation summarizes the','Universal Declaration of Human Rights.','African Charter on Human Rights.','Geneva Conventions and Protocols.','United Nations Organization Charter.','“All human beings are born free and equal in dignity and rights. They are endowed with reason and 		conscience and should act towards one another in a spirit of brotherhood”.','','a','','wassce','2015',57,'Admin','2016-12-12 20:15:43','2020-05-28 21:09:32'),(420,'Effective and responsible parenthood is primarily','a national duty','a military duty','a political duty','an economic duty','','','a','','wassce','2015',58,'Admin','2016-12-12 20:15:43','2020-05-28 21:08:13'),(421,'Association and affiliation between two or more people is called','multilateral relations','bilateral relations','inter-communal relations','interpersonal relations','','','d','','wassce','2015',64,'Admin','2016-12-12 20:15:43','2020-05-28 21:09:53'),(422,'A bill passed by the National Assembly requires the assent of the president before it becomes law. The law can be declared null and void by the court of law. The process above emphasizes the','supremacy of judiciary over other arms of government','relationship among the arms of government','importance of law makers in a democracy','fundamentals of the rule of law.','','','d','','wassce','2015',51,'Admin','2016-12-12 20:15:43','2020-05-28 21:09:17'),(423,'The idea that “Law should be impartial with the people who break it” implies','principle of fair hearing','right to legal representation','equality before the law','prerogative writ of habeas corpus','','','c','','wassce','2015',74,'Admin','2016-12-12 20:15:43','2020-07-02 15:35:16'),(424,'The foreign policy objective of Nigeria as enshrined in the 1999 Constitution exclude the promotion of','national interest','African integration','support for donor agencies','just world economic order','','','c','','wassce','2015',70,'Admin','2016-12-12 20:15:43','2020-05-28 21:10:05'),(425,'Democracy can promote national development if there is','good governance','promotion of culture','immunity for leaders','registration of parties','','','a','','wassce','2015',61,'Admin','2016-12-12 20:15:44','2020-05-28 21:09:53'),(426,'A major civil society group which campaigned against military rule prior to the advent of the Fourth Republic in Nigeria is the','Campaign for Democracy','Save Nigeria Group','Civil Liberties Organization','National Democratic Coalition','','','a','','wassce','2015',62,'Admin','2016-12-12 20:15:44','2020-05-28 21:09:49'),(427,'Which of the following function is not performed by the Public Service Commission?','Evaluating the performance of ministries and departments','Advising government on technical matters','Preparing the annual budget and assenting to it','Organizing enlightenment pro