you waiting for? Let us go and cast our votes for candidates of our choice<br><br> 	<strong>Ade: </strong> I have no interest in an election which not yield any dividend of democracy. Our political elite are only concerned about their interest when they get to the position 	of authority. For crying out loud, I have made up my mind that l will not vote again. <br><br> 	<strong>Zubar: </strong> Haba! Ade, don’t you remember Abraham Lincoln’s words that ‘all men are not just, all men are not true. But ...... for every scoundrel there is a hero, that for every selfish politician, there is a dedicated leader!’ Come on, go and cast your vote so that we can choose the right person for the position and change the political, economic and social directions of our great state.','','b','','wassce','2015',63,'Admin','2016-12-12 20:15:44','2020-05-28 21:08:31'),(435,'It could be inferred from the dialogue that failure to vote in an election would','guarantee citizens’ rights','encourage the emergence of responsive government','promote accountability in governance','perpetuate irresponsible leadership','<strong>Zubar: </strong> Today is the day for gubernatorial elections, Ade what are you waiting for? Let us go and cast our votes for candidates of our choice<br><br> 	<strong>Ade: </strong> I have no interest in an election which not yield any dividend of democracy. Our political elite are only concerned about their interest when they get to the position 	of authority. For crying out loud, I have made up my mind that l will not vote again. <br><br> 	<strong>Zubar: </strong> Haba! Ade, don’t you remember Abraham Lincoln’s words that ‘all men are not just, all men are not true. But ...... for every scoundrel there is a hero, that for every selfish politician, there is a dedicated leader!’ Come on, go and cast your vote so that we can choose the right person for the position and change the political, economic and social directions of our great state.','','d','','wassce','2015',66,'Admin','2016-12-12 20:15:44','2020-05-28 21:09:45'),(436,'From the above dialogue, political leaders can encourage citizens to perform their civic duties by','fulfilling their electoral promises','travelling overseas to seek for foreign investors','engaging in religious activities','visiting all the local governments in the country','<strong>Zubar: </strong> Today is the day for gubernatorial elections, Ade what are you waiting for? Let us go and cast our votes for candidates of our choice<br><br> 	<strong>Ade: </strong> I have no interest in an election which not yield any dividend of democracy. Our political elite are only concerned about their interest when they get to the position 	of authority. For crying out loud, I have made up my mind that l will not vote again. <br><br> 	<strong>Zubar: </strong> Haba! Ade, don’t you remember Abraham Lincoln’s words that ‘all men are not just, all men are not true. But ...... for every scoundrel there is a hero, that for every selfish politician, there is a dedicated leader!’ Come on, go and cast your vote so that we can choose the right person for the position and change the political, economic and social directions of our great state.','','a','','wassce','2015',69,'Admin','2016-12-12 20:15:44','2020-05-28 21:09:22');
