'wassce','2015',89,'Admin','2016-12-12 05:41:49','2020-06-24 09:07:41'),(190,'A dirge is a poem sung','to send a child to sleep','to make workers happy','at a birthday party','at a funeral','','','d','','wassce','2015',92,'Admin','2016-12-12 05:41:49','2020-06-22 17:03:21'),(191,'In drama, the ___________ creates humour','hero','clown','villain','chorus','','','b','','wassce','2015',88,'Admin','2016-12-12 05:41:50','2020-06-22 21:21:23'),(192,'<em>Let me not love thee if l love thee not</em> illustrates','metaphor','proverb','paradox','meiosis','','','c','','wassce','2015',93,'Admin','2016-12-12 05:41:50','2020-06-24 08:59:16'),(193,'__________ is a literary device used to express something unpleasant in a more acceptable manner','Epilogue','Epigram','Euphemism','Eulogy','','','c','','wassce','2015',103,'Admin','2016-12-12 05:41:50','2020-06-22 18:51:42'),(194,'The writer’s attitude to the couple is one of','resignation','indifference','patronage','praise','A modest two-room hut built of mud and roofed with straw graciously sheltered the Mensahs. One of the rooms advertised itself as a living room. The kind earthenware pot willingly kept company with four ever-smiling stools. The pot eternally contained cool water for guests. The second room was a warm-hearted bedroom without a bed. The poor pair had to sleep on bare straw mats on the polished dirt floor. Some over washed rags deputized for blankets and sheets and pillows. Two strong dry logs, facing each other like bitter rivals burned themselves out at night, not merely to keep the couple warm but mainly to ward off hungry mosquitoes and other hostile pests.<br><br> There was no door to ward off the cold night air. Some rude 	devices, however, were contrived to keep the room quite safe from prying eyes and curious domestic animals. Would any thief be ever tempted to peep into <strong>such a rude room of such a poor pair</strong>?','','a','','wassce','2015',97,'Admin','2016-12-12 05:41:50','2020-06-26 18:35:18'),(1