0-06-25 12:01:13'),(345,'The use of gestures to communicate in drama is known as','burlesque','soliloquy','mime','melodrama','based on General Literary Principles.','','c','','utme','2009',110,'Admin','2016-12-12 17:55:03','2020-06-26 18:35:18'),(346,'A short and witty remark is','a limerick','a tercel','an epigram','a litotes','based on General Literary Principles.','','c','','utme','2009',102,'Admin','2016-12-12 17:55:03','2020-06-26 18:35:17'),(347,'An expression that signifies a whole through its significant parts is','synesthesia','synecdoche','metonymy','allegory','based on General Literary Principles.','','b','','utme','2009',98,'Admin','2016-12-12 17:55:03','2020-06-25 11:30:46'),(348,'a structural arrangement of units of composition by which one element of equal importance with another is similarly placed is called','repetition','paradox','refrain','parallelism','based on General Literary Principles.','','d','','utme','2009',95,'Admin','2016-12-12 17:55:03','2020-06-25 11:48:35'),(349,'The pride that contributes to the fall of a tragic character in a play is known as','hamartia','catharsis','hubris','epistasis','based on General Literary Principles.','','a','','utme','2009',111,'Admin','2016-12-12 17:55:03','2020-06-24 20:35:01'),(350,'metrical foot of two stressed or long syllables is called','a spondee','a trochee','an anapest','an iamb','based on General Literary Principles.','','a','','utme','2009',110,'Admin','2016-12-12 17:55:03','2020-06-25 11:28:50'),(351,'A group of three lyric stanzas in classical Greek poetry is referred to as','triplet','triolet','trilogy.','triad','based on General Literary Principles.','','b','','utme','2009',108,'Admin','2016-12-12 17:55:03','2020-06-22 17:35:22'),(352,'Biokun:  I did it for her! Let them laugh!<br>\n				Let them condemn me. I who have always <br>	\n				derided superstition. I have gone bach to the <br>\n				shrine of Olokun. At least if he dies, Oroki <br>\n				will know I tried everything. <br>\n				(Femi I Qsofisan: No More the Wasted Breed)<br>\nBiokun’s mood in this passage is one of','desperation','frustration','anger','anxiety','based on Literary Appreciation','','b','','utme','2009',122,'Admin','2016-12-12 17:55:03','2020-06-24 08:09:25'),(353,'	‘My song is the root<br>\n	touching other roots <br>\n	in a covenant below the crust..’<br>\n	(Niyi  Osundare: Waiting Laughters)<br>\n\nThe imagery used in the second line of the extract above is','olfactory','visual','tactile','auditory','based on Literary Appreciation','','c','','utme','2009',99,'Admin','2016-12-12 17:55:03','2020-06-23 17:38:42'),(354,'‘The huge sacrifice that <br>\n	wards off death <br>\n	The big offering that <br>\n	prevents diseases....’ <br>\n	( Temi Osofison: Morountodun ) <br>\nThe poem above can best be described as','epic','heroic','praise','quatrain','based on Literary Appreciation','','d','','utme','2009',110,'Admin','2016-12-12 17:55:03','2020-06-26 18:35:18'),(355,'Why blame her who denies love for the asking <br><br>\n	And not the Birds and Moths and Beetles <br>\n	That after deep draughts from rich nectar wells <br>\n	Flee the drained petals to virgin flowers. <br>\nThe lines above are an indictment of','adultery','gluttony','flirtation','infertility','based on Literary Appreciation','','b','','utme','2009',96,'Admin','2016-12-12 17:55:03','2020-06-22 19:37:14'),(356,'	Oh, the market is set like the hub of a wheel <br>\n	And it pulfs 	like a magnet strong <br>\n	It is easy to tell <br>\n	How it casts its spell <br>\n	And draws all the crowds along. <br><br>\nThe sound device used in the extract above is','rhyme','alliteration','emphasis','assonance','based on Literary Appreciation','','a','','utme','2009',111,'Admin','2016-12-12 17:55:03','2020-06-26 18:35:18'),(357,'A reference beyond the immediate purview of what is being presented is known as','allusion','diversion','inversion','imagery','based on Literary Appreciation','','a','','utme','2009',113,'Admin','2016-12-12 17:55:03','2020-06-23 11:19:13'),(358,'‘The how is her barber’ The line is an example','metaphor','hyperbole','personification','litotes','based on Literary Appreciation','','a','','utme','2009',105,'Admin','2016-12-12 17:55:04','2020-06-24 08:34:58'),(359,'‘From the sky suspended <br>\n	the strings of tattered pants <br>\n	marched on trembling feet <br>\n	under stone heavy-kits <br>\n	marched, on their breast <br>\n	scared, monogram of skulls and bones.’ <br>\n	( Ossie Enejwe: Mass for the Dead ) <br><br>\n“The subject matter of the extract above is','wastage','war','love','hatred','based on Literary Appreciation','','b','','utme','2009',107,'Admin','2016-12-12 17:55:04','2020-06-25 23:38:59'),(360,'‘Tonderai was assisted by the villages in placing his truck box into the back for the car and he got into the passenger side of the truck. Initially, he was a bit nervous and clearly uncomfortable, his young mind was asking how someone whom, he had almost caused a serious accident could be his benefactor.’ ( Daniel T. Manyika: Two worlds Apart )\n\n<br><br>The narrative point of view used in the extract above can best be described as','omniscient','subjective','panoramic','scenic','based on Literary Appreciation','','a','','utme','2009',102,'Admin','2016-12-12 17:55:04','2020-06-26 18:35:17'),(361,'‘Me to the Orangery<br> \n	Solitude invites, <br>\n	a wagtail, to tell the<br>  			\n	tangled-wood-tale.’ <br>\n	( Christopher Okigbo: Heavengate ) <br><br>\nThe complexity of the poem can be ascribed to the poet’s use of','archaic diction','structural inversion','compound words','extended met','based on Literary Appreciation','','b','','utme','2009',135,'Admin','2016-12-12 17:55:04','2020-06-27 23:16:39');
